import React from 'react';
import * as moment from 'moment'
import 'bootstrap/dist/css/bootstrap.min.css';
import ReactNavbar from './components/BsNavbar.js';
import Content from './components/Content.js';

import {
  HashRouter
} from "react-router-dom";

const routes = [
  {
    name: 'Home',
    route: '/'
  },
  {
    name: 'Extract',
    route: '/extract'
  },
  {
    name: 'Files',
    route: '/files'
  }
];

class App extends React.Component{

  componentDidMount() {
    fetch("http://10.15.10.250:8080/extract_dev2/files")
    .then(res => res.json())
    .then(
        (result) => {
            var dt = result['files']['SCR_RSH_1216_10_02.sql']['date'];
            console.log(dt)

            var start_dt = moment(dt).format('yyy Do YYYY, h:mm:ss a');
            console.log(start_dt);
            this.setState({
                files: result
                // isLoaded: true,
                // selectedOption: "Please choose"
            });
        },
        (error) => {
            this.setState({
                error
            });
            console.log(this.state.error)
        }
    )
  }

  render() {
    return(
      <>
        <HashRouter>
          <ReactNavbar routes={routes} />
          <Content />
        </HashRouter>
      </>
    );
  }
}

export default App;
